import React from "react";

const Necas = ({ text }) => {
  console.log(text);
  return (
    <div className="Firo">
      {text.Search.map((t) => {
        console.log(t.Title);
      })}
    </div>
  );
};

Necas.defaultProps = {
  text: ["Sharknado"],
};

export default Necas;
